It is often we hear, “make sure to listen to your body. Make sure you don’t over train”.

Well, I can tell you that this guy right here was guilty of over-training. 

I got caught up on the numbers, which in turn made me ignore what my body was trying to tell me. 

Last week, I decided to finally listen and take a few days off. 

Best decision ever, not only am I back, but I am starting to see progress on my time. 

Today, life taught me two important lesson. You gotta slow down to speed up! 

And more importantly make sure you find the fun in whatever you do! 
